import ScrollAnim from 'rc-scroll-anim';
import React from 'react';
import ReactDOM from 'react-dom';
import QueueAnim from 'rc-queue-anim';
import TweenOne from 'rc-tween-one';
// import Menu from './components/ui/Menu';

const Link = ScrollAnim.Link;
const Element = ScrollAnim.Element;
const ScrollOverPack = ScrollAnim.OverPack;
const EventListener = ScrollAnim.Event;


class Menu extends React.Component {
  constructor() {
    super();
    this.state = {
      show: false,
    }
    // const classe = this.dom.className;
  }



  render() {


    const count = [0, 1, 2, 3, 4, 5];
    const linkItems = count.map((number) =>
      <Link className={count[number=0] ? 'nav-list': 'nav-list logo'} to={'page'+ number} showHeightActive={['50%', '10%']}>{number}</Link>
    );


    return (
      <div className="nav-wap">


        {linkItems}
      </div>
    );
  }
}





export default Menu;
